import React, { useState, useEffect } from 'react';
import styles from './StudentDashboard.module.css';
import { FaCalendarAlt, FaUsers, FaUserCircle, FaBell, FaBullhorn } from 'react-icons/fa';

const StudentDashboard = () => {
    const [studentName, setStudentName] = useState('');
    const [studentId, setStudentId] = useState('');
    const [upcomingEvents, setUpcomingEvents] = useState([]);
    const [enrolledClubs, setEnrolledClubs] = useState([]);
    const [latestAnnouncements, setLatestAnnouncements] = useState([]);
    const [profileInfo, setProfileInfo] = useState({});

    useEffect(() => {
        const storedStudentName = localStorage.getItem('studentName');
        const storedStudentId = localStorage.getItem('studentId');

        if (storedStudentName && storedStudentId) {
            setStudentName(storedStudentName ? storedStudentName.split(' ')[0] : 'Student');
            setStudentId(storedStudentId);
            fetchStudentDashboardData(storedStudentId);
        }
    }, []);

    const fetchStudentDashboardData = async (studentId) => {
        // Dummy data - replace with your API calls
        setUpcomingEvents([
            { id: 1, title: 'Club Fair', date: 'May 6, 2025', location: 'Main Hall' },
            { id: 2, title: 'Student Union Meeting', date: 'May 9, 2025', time: '3:00 PM' },
            { id: 3, title: 'Workshop: Time Management', date: 'May 11, 2025', time: '10:00 AM' },
        ]);
        setEnrolledClubs(['Photography Club', 'Music Society', 'Debate Team']);
        setLatestAnnouncements([
            { id: 1, title: 'Call for Volunteers - Campus Cleanup', date: 'May 5, 2025' },
            { id: 2, title: 'New Club Added: Robotics Club', date: 'May 4, 2025' },
            { id: 3, title: 'Library Hours Extended for Finals', date: 'May 3, 2025' },
        ]);
        setProfileInfo({
            major: 'Computer Science',
            studentId: studentId,
        });
    };

    return (
        <main className={styles.mainContent}>
            <div className={styles.dashboardContainer}>
                <header className={styles.header}>
                    <div className={styles.headerLeft}>
                        <h1 className={styles.greeting}>Welcome, {studentName}</h1>
                        <p className={styles.studentInfo}>Student ID: {studentId} | Major: {profileInfo.major || 'N/A'}</p>
                    </div>
                    <div className={styles.headerRight}>
                        <div className={styles.notification}>
                            <FaBell className={styles.notificationIcon} />
                            {latestAnnouncements.length > 0 && <span className={styles.notificationCount}>{latestAnnouncements.length}</span>}
                        </div>
                        <div className={styles.userAvatar}>
                            <FaUserCircle className={styles.avatarIcon} />
                        </div>
                    </div>
                </header>

                <div className={styles.dashboardBody}>
                    <section className={styles.section}>
                        <h2 className={styles.sectionTitle}><FaCalendarAlt className={styles.sectionIcon} /> Upcoming Events</h2>
                        {upcomingEvents.length > 0 ? (
                            <div className={styles.eventGrid}>
                                {upcomingEvents.map(event => (
                                    <div key={event.id} className={styles.eventCard}>
                                        <h3 className={styles.eventTitle}>{event.title}</h3>
                                        <p className={styles.eventDate}>{event.date}</p>
                                        {event.time && <p className={styles.eventTime}>{event.time}</p>}
                                        {event.location && <p className={styles.eventLocation}>Location: {event.location}</p>}
                                        <button className={styles.eventButton}>View Details</button>
                                    </div>
                                ))}
                            </div>
                        ) : (
                            <p className={styles.noData}>No upcoming events.</p>
                        )}
                        <button className={styles.viewAllButton}>View All Events</button>
                    </section>

                    <section className={styles.section}>
                        <h2 className={styles.sectionTitle}><FaUsers className={styles.sectionIcon} /> Your Clubs</h2>
                        {enrolledClubs.length > 0 ? (
                            <div className={styles.clubList}>
                                {enrolledClubs.map(club => (
                                    <span key={club} className={styles.clubTag}>{club}</span>
                                ))}
                            </div>
                        ) : (
                            <p className={styles.noData}>Not enrolled in any clubs yet.</p>
                        )}
                        <button className={styles.viewAllButton}>Explore Clubs</button>
                    </section>

                    <section className={styles.section}>
                        <h2 className={styles.sectionTitle}><FaBullhorn className={styles.sectionIcon} /> Latest Announcements</h2>
                        {latestAnnouncements.length > 0 ? (
                            <ul className={styles.announcementList}>
                                {latestAnnouncements.map(announcement => (
                                    <li key={announcement.id} className={styles.announcementItem}>
                                        <span className={styles.announcementTitle}>{announcement.title}</span>
                                        <span className={styles.announcementDate}>{announcement.date}</span>
                                    </li>
                                ))}
                            </ul>
                        ) : (
                            <p className={styles.noData}>No new announcements.</p>
                        )}
                        <button className={styles.viewAllButton}>View All Announcements</button>
                    </section>

                    {/* You can add more sections here */}
                </div>
            </div>
        </main>
    );
};

export default StudentDashboard;
